import './App.css';
import LandingPage from './components/LandingPage/LandingPage';
import config from './config';
import {
  alpha,
  createTheme,
  getContrastRatio,
  ThemeProvider,
} from '@mui/material/styles';

const violetBase = '#7F00FF';
const violetMain = alpha(violetBase, 0.7);

const theme = createTheme({
  palette: {
    basic: {
      main: config.colors.main,
      light: config.colors.light,
      dark: config.colors.dark,
      contrastText: getContrastRatio(violetMain, '#fff') > 4.5 ? 'red' : '#111',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div style={{ backgroundColor: config.colors.primary, top: 0, position: 'absolute', width: '100%' }}>
        <LandingPage />
      </div>
    </ThemeProvider> 
  );
}

export default App;
